window.bookSummaryJSON = "<p>Out of the blue, a young Space Fleet officer's dream becomes reality: He's made captain of a starship. Just in time for the return of humanity's most terrible enemy, after 50 years of peace.<br> <br> To survive against this enemy, Captain Tad Thatcher will have to do more than learn how to become an effective commander, or how to wrangle his wayward crew. He will need to reinvent space combat. From scratch.</p> <p><b>We hope you like space battles. Buckle up for Spacers, the military sci-fi series you've been waiting for. Download this six-book box set today.</b></p>"; 
